import React from "react";

import "./Header.css";

function Header() {
  return (
    <>
      <header className="header">
        <div></div>
        <div className="header1">
        <button>Home</button>
        <button>New</button>
        <button>Old</button>
      </div>
      </header>

      
    </>
  );
}

export default Header;
